n//      border-radius: 4px;\n//      border: 2px solid white; /* should match background, can't be transparent */\n//      background-color: rgba(0, 0, 0, .5);\n//    }\n  }\n  .slick-header,\n  .slick-headerrow,\n  .slick-footerrow {\n    overflow: hidden;\n  }\n  .slick-headerrow {\n    border-top-color: transparent;\n    border-top-width: 0;\n  }\n\n  .slick-top-panel,\n  .slick-header-columns,\n  .slick-headerrow-columns,\n  .slick-footerrow-columns {\n    position: relative;\n    white-space: nowrap;\n    cursor: default;\n    overflow: hidden;\n    margin: 0;\n    padding: 0;\n    border: 0;\n    outline: 0;\n  }\n\n  .slick-cell,\n  .slick-header-column,\n  .slick-headerrow-column,\n  .slick-footerrow-column {\n    position: absolute;\n    top: 0;\n    bottom: 0;\n\n    border: 1px solid $grid-border-color;\n    border-top-color: transparent;\n    border-left-color: transparent;\n    border-top-width: 0;\n    border-left-width: 0;\n    margin: 0;\n    padding: 0;\n\n//    overflow-x: scroll;\t\t//Obscures cell contents on Windows\n    overflow: hidden;\n//    text-overflow: ellipsis;\n    vertical-align: middle;\n//    z-index: 1;\n    white-space: nowrap;\n    cursor: default;\n\n    // do not include a bottom border for the bottom-most = leaf header cells:\n    // that border will be provided by the rows container.\n    &.slick-header-is-leaf {\n      border-bottom-color: transparent;\n      border-bottom-width: 0;\n    }\n  }\n\n  .slick-header-column.ui-state-default {\n    position: relative;\n    display: inline-block;\n    box-sizing: content-box !important;\n    overflow: hidden;\n//    text-overflow: ellipsis;\n    height: 1em;\n    line-height: 1em;\n    margin: 0;\n    padding: 4px;\n    border-right: 1px solid $grid-border-color;\n    border-left: 0px !important;\n    border-top: 0px !important;\n    border-bottom: 0px !important;\n    float: left;\n  }\n\n\n  .slick-cell {\n    box-sizing: border-box;\n    border-style: $grid-border-style;\n    padding: 1px 2px 1px 2px;\n  }\n\n  .slick-header-column {\n    padding: $cell-padding-top $cell-padding-right $cell-padding-bottom $cell-padding-left;\n  }\n\n  .grid-canvas {\n    position: relative;\n    outline: 0;\n  }\n\n  .slick-row {\n    position: absolute;\n    border: 0;\n    width: 100%;\n  }\n\n  .slick-header-column-sorted {\n    font-style: italic;\n  }\n\n  .slick-sort-indicator {\n    display: inline-block;\n    width: 8px;\n    height: 5px;\n    margins: 0;\n    position: absolute;\n    left: 2px;\n    bottom: 3px;\n  }\n  .slick-header-column-order {\n    display: inline-block;\n    position: absolute;\n    width: 10px;\n    height: 16px;\n    margins: 0;\n    left: 4px;\n    bottom: 6px;\n    padding: 0;\n//border: 1px solid red;\n    font-size: 0.75em;\n  }\n\n  .slick-sort-indicator-desc {\n//    background: url('../images/sort-desc.png');\n    border-left: 5px solid transparent;\n    border-right: 5px solid transparent;\n    border-top: 5px solid black;\n  }\n\n  .slick-sort-indicator-asc {\n//    background: url('../images/sort-asc.png');\n    border-left: 5px solid transparent;\n    border-right: 5px solid transparent;\n    border-bottom: 5px solid black;\n  }\n\n  .slick-header-sortable .slick-column-name {\n    margin-left: 10px;\n  }\n\n  .slick-header.ui-state-default {\n    box-shadow: 0 1px 2px rgba(0,0,0,.1);\n  }\n\n  .slick-column-name {\n//    position: absolute;\n//    text-overflow: ellipsis;\n  }\n\n  .slick-resizable-handle {\n    position: absolute;\n    font-size: 0.1px;\n    display: block;\n    cursor: col-resize;\n    width: 5px;\n    right: 0;\n    top: 0;\n    height: 100%;\n  }\n\n  .slick-resizable-handle-hover {\n    background-color: #ccc;\n  }\n\n  .slick-sortable-placeholder {\n    background: silver;\n  }\n\n  .slick-group {\n  }\n\n  .slick-group-toggle {\n    display: inline-block;\n  }\n\n  .slick-cell {\n    &.highlighted {\n      background: lightskyblue;\n      background: rgba(0, 0, 255, 0.2);\n      transition: all 0.5s;\n    }\n\n    &.flashing {\n      border: 1px solid red !important;\n    }\n\n    &.editable {\n//      z-index: 3;\n      overflow: visible;\n      background: white;\n      border-color: black;\n      border-style: solid;\n    }\n\n    &:focus {\n      outline: none;\n    }\n  }\n\n  .slick-reorder-proxy {\n    display: inline-block;\n    background: blue;\n    opacity: 0.15;\n    cursor: move;\n  }\n\n  .slick-reorder-guide {\n    display: inline-block;\n    height: 2px;\n    background: blue;\n    opacity: 0.7;\n  }\n\n  .slick-selection {\n//    z-index: 2;\n    position: absolute;\n    border: 2px dashed black;\n  }\n\n  .slick-pane {\n    position: absolute;\n    outline: 0;\n    overflow: hidden;\n    width: 100%;\n  }\n}\n\n.flatpickr-wrapper {\n//  z-index: 5;\n}\n\n.interact-placeholder {\n  background: red !important;\n  display: inline-block;\n  float:left;\n  transform: translate(0px, -100%);\n}\n\n.interact-drop-active {\n  box-shadow: inset 0 0 8px rgba(7, 67, 128, 0.5);\n}\n\n.interact-can-drop {\n  opacity: .9;\n}\n\n\n.scrollbar-fix {\n  &::-webkit-scrollbar {\n    -webkit-appearance: none;\n  }\n}\n","\n  $grid-border-color: #a0a0a0;\n  $grid-border-style: solid;\n  $grid-header-background: #d8d8d8;\n\n  $grid-cell-color: #f0f0fc;\n  $grid-cell-color-odd: #fafaff;\n  $grid-cell-selected-color: #e8e8ff;\n\n  $cell-padding-top: 4px;\n  $cell-padding-right: 4px;\n  $cell-padding-bottom: 4px;\n  $cell-padding-left: 4px;\n\n  @import './slick.grid.scss';\n  @import './slick.theme.scss';\n\n  .wylib-mlb {\n//    border: 1px solid green;\n    height: 100%;\n    max-width: 80vw;\n  }\n  .wylib-mlb .slickgrid-container {\n//    border: 1px solid red;\n//    width: auto;\n  }\n  .wylib-mlb .align-right {\n    text-align: right;\n  }\n  .wylib-mlb .align-center {\n    text-align: center;\n  }\n  .wylib-mlb .align-left {\n    text-align: left;\n  }\n","/*\n * IMPORTANT:\n * In order to preserve the uniform grid appearance, all cell styles nee